Selling re-arsonaled 1944 M1 Carbine by Quality Hardware
Barrel is by Underwood.
Comes with GI sling;
(2) 15 round magazines;
(1) 5 round magazine;
(1) 30 round magazine;
(1) magazine coupler.
Stock and hand guard are gorgeous.  Made by Rock-ola with little if not any oil in the wood.  Near blemish free.  Interesting X5 marking on the comb.
